def bin_i(n): #binary indices
    return([(i+1) for i, x in enumerate(bin(n)[2:][::-1]) if x =='1'])
def A326031(n): return sum(i.bit_count() for i in bin_i(n)) # _John Tyler Rascoe_, Jun 08 2024

